// ==UserScript==
// @name         Umgebungsunterscheider
// @description  FÃ¤rbt Header der verschiedenen Umgebungen um Versehen zu vermeiden
// @namespace    http://tampermonkey.net/
// @version      1.0
// @updateURL    https://raw.githubusercontent.com/123erfasst/tampermonkey-scripts/master/umgebungsunterscheider.user.js
